import { Outlet, Link } from "react-router-dom";

export default function Layout() {
  const navItemStyle = {
    display: "inline-block",
    listStyleType: "none",
    padding: 0,
    margin: 0,
    marginLeft: -20,
  };

  return (
    <nav>
      <ul>
        <li style={navItemStyle + { marginLeft: -20 }}>
          <Link to={"/"}>Tic-Tac-Toe</Link>
        </li>
        <li style={navItemStyle}>
          <Link to={"/calc"}>Calculator</Link>
        </li>
      </ul>
      <Outlet></Outlet>
    </nav>
  );
}
